import React from 'react'
import { useStripe, useElements, PaymentElement } from '@stripe/react-stripe-js';


const CheckOutForm = () => {
    const stripe = useStripe();
    const elements = useElements();

    return (
        <div>
            <form>
                <PaymentElement />
                <button>Submit</button>
            </form>
        </div>
    )
}

export default CheckOutForm
